import React, { useState } from "react";
import Modal from "react-bootstrap/Modal";
import prevButton from "./assets/button-prev.png";
import nextButton from "./assets/button-next.png";
import Button from "react-bootstrap/Button";

export default function CustomModal(props) {
  const { id, img} = props;
  const [modalShow, setModalShow] = useState(false);

  return (
    <div style = {{ display : modalShow ? "block" : "none" }}>
    <Modal
      {...props}
      size="lg"
      aria-labelledby="contained-modal-title-vcenter"
      centered
    >
      <Modal.Header id = {id} img = {img}>
        <img src = {img} alt={id} />
        <Modal.Title id="contained-modal-title-vcenter"></Modal.Title>
      </Modal.Header>

      <Modal.Body>
        <h4></h4>

        <p></p>
      </Modal.Body>
      <Modal.Footer>
        <Button>
          {" "}
          <img src={prevButton} id="prev" />{" "}
        </Button>
        <Button>
          {" "}
          <img src={nextButton} id="next" />{" "}
        </Button>
      </Modal.Footer>
    </Modal>
    </div>
  );
}
